import React from 'react';
import './Footer.css';

const Footer = () => {
	return (
		<footer className="footer">
			<div className="container footer-inner">
				<div className="footer-brand">
					<img src="/asset/log.png" alt="Hi Dezign" className="footer-logo" />
					<p className="footer-tagline">Designing spaces that welcome every story.</p>
				</div>

				<nav className="footer-nav">
					<a href="#about" className="footer-link">About</a>
					<a href="#services" className="footer-link">Services</a>
					<a href="#portfolio" className="footer-link">Portfolio</a>
					<a href="#clients" className="footer-link">Clients</a>
					<a href="#contact" className="footer-link">Contact</a>
				</nav>
			</div>

			<div className="footer-bottom">
				<p className="footer-copy">Â© {new Date().getFullYear()} Hi Dezign. All rights reserved.</p>
				<p className="footer-credit">Created by <a href="https://www.codescrafters.in" target="_blank" rel="noreferrer">CodesCrafters</a></p>
			</div>
		</footer>
	);
};

export default Footer;
